	vl::Ptr<genericambiguity::Module> ModuleParser::ParseModule(const vl::WString& input, vl::vint codeIndex) const
	{
		 return ParseWithString<genericambiguity::Module, ModuleParserStates::Module>(input, this, codeIndex);
	};

